void updateDesign(InventDimFormDesignUpdate mode)
{
    InventMovement movement = InventMovement::construct(PurchLine::findInventTransId(purchLineAllVersions.InventTransId));
    Set            validInventDimDSset;

    switch (mode)
    {
        case InventDimFormDesignUpdate::Init:
            if (!inventDimFormSetup)
            {
                validInventDimDSset = new Set(Types::String);
                validInventDimDSset.add(inventDim_ds.name());
                inventDimFormSetup  = InventDimCtrl_Frm_Mov_OrderLine::newFromFormMovement(element, movement, validInventDimDSset);
            }
        case InventDimFormDesignUpdate::Active,
             InventDimFormDesignUpdate::FieldChange:
            inventDimFormSetup.formActiveSetup(movement.inventDimGroupSetup(), movement);
            inventDimFormSetup.formSetControls(mode == InventDimFormDesignUpdate::Active);
            break;

        default : throw error(strFmt("@SYS54195",funcName()));
    }

    if (PurchIsSupplierShipmentDatesControlsVisibleFlight::instance().isEnabled())
    {
        boolean isSupplierShipmentDatesEnabled = PurchParameters::find().IsSupplierShipmentDatesEnabled;
        Delivery_ShipCalendarId.visible(isSupplierShipmentDatesEnabled);
        Delivery_RequestedShipDate.visible(isSupplierShipmentDatesEnabled);
        PurchLine_RequestedShipDate.visible(isSupplierShipmentDatesEnabled);
        PurchLine_ConfirmedShipDate.visible(isSupplierShipmentDatesEnabled);
    }
}

public void init()
{
    super();
    this.query().dataSourceTable(this.table()).addOrderByField(fieldNum(PurchTableAllVersions, VersionDateTime), SortOrder::Descending);
}

public int active()
{
    int ret;

    ret = super();

    element.updateDesign(InventDimFormDesignUpdate::Active);

    return ret;
}

public void init()
{
    QueryBuildDataSource    qbDS;

    super();

    qbDS = this.query().dataSourceTable(this.table());
    qbDS.addDynalink(fieldNum(PurchLineAllVersions, PurchId), purchTableAllVersions, fieldNum(PurchTableAllVersions, PurchId));
    qbDS.addDynalink(fieldNum(PurchLineAllVersions, VersionDateTime), purchTableAllVersions, fieldNum(PurchTableAllVersions, VersionDateTime));
}

public void init()
{
    Query                   query;
    QueryBuildDataSource    qbDS;

    super();

    query  = this.query();
    qbDS = query.dataSourceTable(this.table());

    query.validTimeStateDateTimeRange(DateTimeUtil::minValue(), DateTimeUtil::maxValue());
    qbDS.addDynalink(fieldNum(LogisticsPostalAddress, RecId), purchTableAllVersions, fieldNum(PurchTableAllVersions, DeliveryPostalAddress));
}

/// <summary>
/// Method is used to open the <c>LogisticsPostalAddress</c> form for Location field.
/// </summary>
public void jumpRef()
{
    Args    args = new Args();

    args.openMode(OpenMode::View);
    args.caller(this);
    args.lookupTable(tableNum(LogisticsPostalAddress));
    args.lookupField(fieldnum(LogisticsPostalAddress, RecId));
    args.lookupValue(int642str(logisticsPostalAddressHeader.RecId));

    MenuFunction::runClient(menuitemDisplayStr(LogisticsPostalAddressEdit), MenuItemType::Display, true, args);
}

